import React, { useState } from 'react';
import { Header, Icon, Segment, Grid, Modal, Button, Embed, Image, Rating, Divider, List } from 'semantic-ui-react';
import ReactPlayer from 'react-player'

const _SearchMovieListDisplay = (props) => {
    return (
        <React.Fragment>

            <List bulleted horizontal>
                <center className="customImageDisplay">
                    <Image onClick={props.movieDetails} src={props.movieImage} className="sizeOfNewSearchMovie" />
                     Rating: {props.movie.vote_average * 10}%{" "}
                     Release date: {props.movie.release_date || props.movie.first_air_date}  Runtime: {props.movie.runtime || props.movie.episode_run_time}m
                     Overview : {props.movie.overviews}
                </center>
            </List >
        </React.Fragment >
    )
}

export default _SearchMovieListDisplay;
